Plot:
They first met at WEC 53, where Anthony Pettis stole the belt from Benson Henderson with a kick still seen on highlight reels today. Now Bendo has the UFC belt, and this time he doesn't plan on giving it up. See both men prepare for a storybook rematch. Heavyweights Frank Mir and Josh Barnett first fought on the same card at UFC 34. Now, 130 numbered events later, the two former champions will finally meet in clash of two of the division's best submission wrestlers... and trash-talkers. Featherweight Chad Mendes has been on a tear, knocking out his last three opponents by KO as he works his way to another title shot. But fan favorite Clay Guida looks to bring his fast-paced style to stymie the Team Alpha Male member.

